import React, {Component} from 'react';
import YoutubeComp from "../../component/YoutubeComp/YoutubeComp";
import Product from "../Product/Product";
import LifeCycleComp from "../LifeCycleComp/LifeCycleComp";
import BlogPost from "../BlogPost/BlogPost";

class Home extends Component {
    state = {
        showComponent: true
    }
    componentDidMount() {
        // setTimeout(() => {
        //     this.setState({
        //         showComponent: false
        //     })
        // }, 15000)
    }

    render() {
        return (
            <div>
                <p>Youtube Component</p>
                <hr/>
                <YoutubeComp
                    time={"7.12"}
                    title={"Judul 1"}
                    desc={"Deskripsi 1"}/>
                <YoutubeComp
                    time={"8.11"}
                    title={"Judul 2"}
                    desc={"Deskripsi 2"}/>
                <YoutubeComp
                    time={"12.12"}
                    title={"Judul 3"}
                    desc={"Deskripsi 3"}/>
                <YoutubeComp
                    time={"3.14"}
                    title={"Judul 4"}
                    desc={"Deskripsi 4"}/>
                <YoutubeComp/>

                <p>Counter</p>
                <hr/>
                <Product/>

                <p>Life Cycle Component</p>
                <hr/>
                {this.state.showComponent ? <LifeCycleComp/> : null}

                <p>Blog Post</p>
                <hr/>
                <BlogPost/>
            </div>
        )
    }
}

export default Home;
